window.bookSummaryJSON = "<p>Adam Kingsley reigns as the young prince of Manhattan. Everything he touches turns to gold, making him the envy of Wall Street. Women swoon at his feet, money is no object, and his killer good looks are as wicked as sin. A dangerous trifecta that allows him to possess anything or anyone he desires.What more could a 32-year-old man wish for? Maybe that his life never changes and his murky past stays far away. Sounds reasonable, yet life seldom is. Kathryn Delcour is an alluring socialite with unique erotic tastes who helps others find true sexual fulfillment. When she suddenly appears on the New York City social scene, Adam finds this complex woman too tempting to resist. He will stop at nothing to have her, yet she is warned to stay away from him and his player ways. Kathryn tries to keep him at arm's length, but her arms may not be strong enough to hold the charismatic Adam Kingsley at bay. </p>"; 
